  <div
    style={{
      paddingLeft: "2%",
      paddingRight: "2%",
      backgroundColor: "#cce6ff",
    }}
  >
    <h3 className="display-5 text-center mb-4">
      Sanctions Screening of Payments Transactions
    </h3>

    <FileUpload />
    <div style={{ paddingTop: "10px" }}>
      <Header />
    </div>
  </div>
);

export default App;
